import React, { useState, useEffect } from 'react';
import { Table, Button, Space, message, Modal, Tag, Checkbox } from 'antd';
import { DeleteOutlined, ExportOutlined, ClearOutlined } from '@ant-design/icons';
import { getNotes, deleteNote, exportNotes } from '../api';
import { useNavigate } from 'react-router-dom';
import './NotesList.css';

const NotesList = () => {
    const [notes, setNotes] = useState([]);
    const [loading, setLoading] = useState(false);
    const [exporting, setExporting] = useState(false);
    const [selectedNotes, setSelectedNotes] = useState([]);
    const navigate = useNavigate();

    useEffect(() => {
        fetchNotes();
    }, []);

    const fetchNotes = async () => {
        try {
            setLoading(true);
            const data = await getNotes();
            setNotes(data);
        } catch (error) {
            message.error('获取笔记失败：' + error.message);
        } finally {
            setLoading(false);
        }
    };

    const handleDelete = async (id) => {
        try {
            await deleteNote(id);
            message.success('删除成功');
            fetchNotes();
        } catch (error) {
            message.error('删除失败：' + error.message);
        }
    };

    const handleExportNotes = async () => {
        if (selectedNotes.length === 0) {
            Modal.confirm({
                title: '导出确认',
                content: '您没有选择任何笔记，是否导出全部笔记？',
                onOk: async () => {
                    try {
                        setExporting(true);
                        await exportNotes('');
                        message.success('导出成功！');
                    } catch (error) {
                        message.error('导出失败：' + error.message);
                    } finally {
                        setExporting(false);
                    }
                }
            });
            return;
        }

        try {
            setExporting(true);
            const selectedIds = selectedNotes.join(',');
            console.log('导出选中的笔记ID:', selectedIds);
            await exportNotes(selectedIds);
            message.success('导出成功！');
        } catch (error) {
            console.error('导出笔记失败:', error);
            message.error('导出失败：' + error.message);
        } finally {
            setExporting(false);
        }
    };

    const handleClearSelection = () => {
        setSelectedNotes([]);
    };

    const rowSelection = {
        selectedRowKeys: selectedNotes,
        onChange: (selectedRowKeys) => {
            setSelectedNotes(selectedRowKeys);
        }
    };

    const columns = [
        {
            title: '内容',
            dataIndex: 'content',
            key: 'content',
            render: (text) => <div className="note-content">{text}</div>
        },
        {
            title: '来源',
            dataIndex: 'url',
            key: 'url',
            render: (url) => url ? (
                <a href={url} target="_blank" rel="noopener noreferrer">
                    {new URL(url).hostname}
                </a>
            ) : '-'
        },
        {
            title: '标签',
            dataIndex: 'tags',
            key: 'tags',
            render: (tags) => (
                <>
                    {tags?.split(',').filter(Boolean).map((tag) => (
                        <Tag key={tag}>{tag.trim()}</Tag>
                    ))}
                </>
            )
        },
        {
            title: '创建时间',
            dataIndex: 'createdAt',
            key: 'createdAt',
            render: (date) => new Date(date).toLocaleString()
        },
        {
            title: '操作',
            key: 'action',
            render: (_, record) => (
                <Space size="middle">
                    <Button
                        type="text"
                        danger
                        icon={<DeleteOutlined />}
                        onClick={() => {
                            Modal.confirm({
                                title: '确认删除',
                                content: '确定要删除这条笔记吗？',
                                onOk: () => handleDelete(record.id)
                            });
                        }}
                    >
                        删除
                    </Button>
                </Space>
            )
        }
    ];

    return (
        <div className="notes-list-container">
            <div className="notes-list-header">
                <h1>我的笔记</h1>
                <Space>
                    {selectedNotes.length > 0 && (
                        <Button
                            icon={<ClearOutlined />}
                            onClick={handleClearSelection}
                        >
                            清除选择 ({selectedNotes.length})
                        </Button>
                    )}
                    <Button
                        type="primary"
                        icon={<ExportOutlined />}
                        onClick={handleExportNotes}
                        loading={exporting}
                    >
                        {selectedNotes.length > 0 ? `导出选中笔记 (${selectedNotes.length})` : '导出全部笔记'}
                    </Button>
                </Space>
            </div>
            <Table
                rowSelection={rowSelection}
                columns={columns}
                dataSource={notes}
                rowKey="id"
                loading={loading}
                pagination={{
                    defaultPageSize: 10,
                    showSizeChanger: true,
                    showTotal: (total) => `共 ${total} 条笔记`
                }}
            />
        </div>
    );
};

export default NotesList;
